import React from "react";
import classes from "./MyPosts.module.css";
import anonymous from "../../../media/create_account_2_anonymous.png"
import Post from "./Post/Post";


const MyPosts = () => {

    let postData = [
        {id:1, message: "Hi,from Java man", likesCount: 25},
        {id:1, message: "Python the best_ ho-ho-ho", likesCount: 55}
    ]


    return (
        <div>
            My posts
            <div>
                <textarea></textarea>
                <button>Add post</button>
                <button>Remove</button>
            </div>

            <div className={classes.posts}>
                <Post message={postData[0].message} likeCounts={postData[0].likesCount}/>
                <Post message={postData[1].message} likeCounts={postData[1].likesCount}/>
            </div>
        </div>
    )
}

export default MyPosts;
